import {BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ScrollToTop from './components/ScrollHandle';
import Home from './pages/home';
import './App.css'
import LoginCard from './components/loginCard';
import RegisterCard from './components/Register';
import PatientPortal from './pages/HomeWithData';
// import LoginCard from './components/login';

function App() {
  return (
    <div>
      <Router>
        <ScrollToTop></ScrollToTop>
        <Routes>
          <Route path='/' element={<Home></Home>}/>
          <Route path='/login' element={<LoginCard></LoginCard>}/>
          <Route path='/register' element={<RegisterCard></RegisterCard>}/>
          <Route path='/patient' element={<PatientPortal></PatientPortal>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
